import Course from '../components/CourseDetails/Course/Course';
import Footers from '../components/Home/Footers';
import Header from '../components/Home/Header';


const CourseDetails = () => {


  return (
    <div className="App1">
      <Header />
      <Course />
      <Footers />
     
    </div>
  );
};

export default CourseDetails;
